{
  "translationLines": [
    {
      "lineNumber": 108671,
      "originalJapaneseLine": "「食わせろ。」",
      "translatedEnglishLine": "\"Feed me.\""
    },
    {
      "lineNumber": 108672,
      "originalJapaneseLine": "　あーーーん」",
      "translatedEnglishLine": "\"Aaaahn.\""
    },
    {
      "lineNumber": 108673,
      "originalJapaneseLine": "「ん……」",
      "translatedEnglishLine": "\"Nn...\""
    },
    {
      "lineNumber": 108674,
      "originalJapaneseLine": "ランスの口の中に卵焼きをポイと放り込む。",
      "translatedEnglishLine": "She tosses a piece of rolled omelet into Rance’s mouth."
    },
    {
      "lineNumber": 108675,
      "originalJapaneseLine": "「どうだ？」",
      "translatedEnglishLine": "\"How is it?\""
    },
    {
      "lineNumber": 108676,
      "originalJapaneseLine": "「んむ、美味い美味い。",
      "translatedEnglishLine": "\"Mm, tasty, tasty."
    },
    {
      "lineNumber": 108677,
      "originalJapaneseLine": "　だが卵焼きは甘い甘いな方が好きだ」",
      "translatedEnglishLine": "But I prefer my rolled omelet sweet, sweet.\""
    },
    {
      "lineNumber": 108678,
      "originalJapaneseLine": "「そうか、覚えておく。",
      "translatedEnglishLine": "\"Is that so? I'll remember that."
    },
    {
      "lineNumber": 108679,
      "originalJapaneseLine": "　では、これも食べてみてくれ」",
      "translatedEnglishLine": "Now, please try this as well.\""
    },
    {
      "lineNumber": 108680,
      "originalJapaneseLine": "「あーーーん」",
      "translatedEnglishLine": "\"Aaaahn.\""
    },
    {
      "lineNumber": 108681,
      "originalJapaneseLine": "「んむ、もぐもぐ」",
      "translatedEnglishLine": "\"Mm, munch munch.\""
    },
    {
      "lineNumber": 108682,
      "originalJapaneseLine": "「あーーーん」",
      "translatedEnglishLine": "\"Aaaahn.\""
    },
    {
      "lineNumber": 108683,
      "originalJapaneseLine": "「んむ、もぐもぐ」",
      "translatedEnglishLine": "\"Mm, munch munch.\""
    },
    {
      "lineNumber": 108684,
      "originalJapaneseLine": "しばらくお互い大したことも話さず、",
      "translatedEnglishLine": "For a while, without saying much to each other,"
    },
    {
      "lineNumber": 108685,
      "originalJapaneseLine": "ご飯を食べさせる不思議な時間が続く。",
      "translatedEnglishLine": "a strange time of feeding each other continued."
    },
    {
      "lineNumber": 108686,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 108687,
      "originalJapaneseLine": "「なんかあんまり……",
      "translatedEnglishLine": "\"Somehow, it's not really..."
    },
    {
      "lineNumber": 108688,
      "originalJapaneseLine": "　楽しくないな……」",
      "translatedEnglishLine": "fun...\""
    },
    {
      "lineNumber": 108689,
      "originalJapaneseLine": "「そうか？」",
      "translatedEnglishLine": "\"Is that so?\""
    },
    {
      "lineNumber": 108690,
      "originalJapaneseLine": "「うむ」",
      "translatedEnglishLine": "\"Yes.\""
    },
    {
      "lineNumber": 108691,
      "originalJapaneseLine": "「もしかして……",
      "translatedEnglishLine": "\"Could it be...\""
    },
    {
      "lineNumber": 108692,
      "originalJapaneseLine": "「少し照れているか？」",
      "translatedEnglishLine": "\"Are you a little embarrassed?\""
    },
    {
      "lineNumber": 108693,
      "originalJapaneseLine": "「照れるというか……",
      "translatedEnglishLine": "\"It's not exactly embarrassment..."
    },
    {
      "lineNumber": 108694,
      "originalJapaneseLine": "「なんか……",
      "translatedEnglishLine": "\"It's just..."
    },
    {
      "lineNumber": 108695,
      "originalJapaneseLine": "　赤子にでもなった気分で情けない……」",
      "translatedEnglishLine": "I feel pathetic, like I’ve become a baby...\""
    },
    {
      "lineNumber": 108696,
      "originalJapaneseLine": "「お前にやられると、",
      "translatedEnglishLine": "\"When you do this to me,"
    },
    {
      "lineNumber": 108697,
      "originalJapaneseLine": "　奉仕されてると言うより、",
      "translatedEnglishLine": "it doesn’t feel like I’m being served,"
    },
    {
      "lineNumber": 108698,
      "originalJapaneseLine": "　面倒見られてる気分だ」",
      "translatedEnglishLine": "but rather like I’m being looked after.\""
    },
    {
      "lineNumber": 108699,
      "originalJapaneseLine": "「奇遇だな。",
      "translatedEnglishLine": "\"What a coincidence."
    },
    {
      "lineNumber": 108700,
      "originalJapaneseLine": "　私もリセットが熱を出した時に",
      "translatedEnglishLine": "I was also just thinking about when Reset had a fever"
    },
    {
      "lineNumber": 108701,
      "originalJapaneseLine": "　世話をしたときのことを思い出していた」",
      "translatedEnglishLine": "and I took care of her.\""
    },
    {
      "lineNumber": 108702,
      "originalJapaneseLine": "「で、次は何を食べる？",
      "translatedEnglishLine": "\"So, what will you eat next?"
    },
    {
      "lineNumber": 108703,
      "originalJapaneseLine": "　このきんぴらなんかはどうだ？」",
      "translatedEnglishLine": "How about some of this kinpira?\""
    },
    {
      "lineNumber": 108704,
      "originalJapaneseLine": "「だー、もういい！　もういい！",
      "translatedEnglishLine": "\"Ah—no more! No more!"
    },
    {
      "lineNumber": 108705,
      "originalJapaneseLine": "　あんまり楽しくないぞこれ！」",
      "translatedEnglishLine": "This isn’t very fun at all!\""
    },
    {
      "lineNumber": 108706,
      "originalJapaneseLine": "「いいじゃないか。",
      "translatedEnglishLine": "\"What’s wrong with that?"
    },
    {
      "lineNumber": 108707,
      "originalJapaneseLine": "　私は少し楽しくなってきたところだ」",
      "translatedEnglishLine": "I’m actually starting to enjoy it a little.\""
    },
    {
      "lineNumber": 108708,
      "originalJapaneseLine": "「えーい、やめんか！」",
      "translatedEnglishLine": "\"Hey, stop that!\""
    },
    {
      "lineNumber": 108709,
      "originalJapaneseLine": "「きゃあ、すごいわ……",
      "translatedEnglishLine": "\"Kyaa, amazing..."
    },
    {
      "lineNumber": 108710,
      "originalJapaneseLine": "　隊長とランス様が、あんなイチャイチャと……」",
      "translatedEnglishLine": "The captain and Lord Rance are getting all lovey-dovey like that...\""
    },
    {
      "lineNumber": 108711,
      "originalJapaneseLine": "「ひゃあああああ……！」",
      "translatedEnglishLine": "\"Hyaaaaaa...!\""
    },
    {
      "lineNumber": 108712,
      "originalJapaneseLine": "ランスとイージスは周りの子達には",
      "translatedEnglishLine": "To the children around them,"
    },
    {
      "lineNumber": 108713,
      "originalJapaneseLine": "すっかり仲むつまじい恋人として見られていた。",
      "translatedEnglishLine": "Rance and Aegis appeared as completely loving lovers."
    },
    {
      "lineNumber": 108714,
      "originalJapaneseLine": "「あーーーん」",
      "translatedEnglishLine": "\"Aaaahn.\""
    },
    {
      "lineNumber": 108715,
      "originalJapaneseLine": "「んむ、もぐもぐ……」",
      "translatedEnglishLine": "\"Mm, munch munch...\""
    },
    {
      "lineNumber": 108716,
      "originalJapaneseLine": "「しかし、あれだな……」",
      "translatedEnglishLine": "\"But you know...\""
    },
    {
      "lineNumber": 108717,
      "originalJapaneseLine": "「んー？」",
      "translatedEnglishLine": "\"Hmm?\""
    },
    {
      "lineNumber": 108718,
      "originalJapaneseLine": "「手のかかる弟とはこんな感じかな」",
      "translatedEnglishLine": "\"I guess that's what it's like with a troublesome younger brother.\""
    },
    {
      "lineNumber": 108719,
      "originalJapaneseLine": "「恋人だろう！？",
      "translatedEnglishLine": "\"Aren't we lovers though?!\""
    },
    {
      "lineNumber": 108720,
      "originalJapaneseLine": "ランスとイージスは恋人らしい時間を過ごした。",
      "translatedEnglishLine": "Rance and Aegis spent time like a proper couple."
    },
    {
      "lineNumber": 108721,
      "originalJapaneseLine": "「……ん？」",
      "translatedEnglishLine": "\"...Hm?\""
    },
    {
      "lineNumber": 108722,
      "originalJapaneseLine": "「よう、イージス。",
      "translatedEnglishLine": "\"Hey, Aegis."
    },
    {
      "lineNumber": 108723,
      "originalJapaneseLine": "　どっか出かけるのか？」",
      "translatedEnglishLine": "Are you going somewhere?\""
    },
    {
      "lineNumber": 108724,
      "originalJapaneseLine": "「ああ、街の方に出てみようかと」",
      "translatedEnglishLine": "\"Yeah, I was thinking of heading into town.\""
    },
    {
      "lineNumber": 108725,
      "originalJapaneseLine": "「なら俺も一緒に行くか」",
      "translatedEnglishLine": "\"Then I’ll go with you.\""
    },
    {
      "lineNumber": 108726,
      "originalJapaneseLine": "「考えてみたらお前とは",
      "translatedEnglishLine": "\"Now that I think about it, I haven’t really gone out together with you much.\""
    },
    {
      "lineNumber": 108727,
      "originalJapaneseLine": "　あまり一緒に出かけるとかもなかったしな」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 108728,
      "originalJapaneseLine": "「デートだ、デート。",
      "translatedEnglishLine": "\"A date, a date."
    },
    {
      "lineNumber": 108729,
      "originalJapaneseLine": "　なんたって俺達は恋人なんだ、",
      "translatedEnglishLine": "After all, we’re lovers,"
    },
    {
      "lineNumber": 108730,
      "originalJapaneseLine": "　たまには恋人らしいこともせんとな」",
      "translatedEnglishLine": "so sometimes we have to act like it too.\""
    }
  ]
}

